下面我们使用 crossbeam 和 crossbeam-channel 来创建一个并行流水线：流水线的两端分别是数据源和数据下沉( sink )，在流水线中间，有两个工作线程会从源头接收数据，对数据进行并行处理，最后将数据下沉。 消息通道( channel )是 crossbeam_channel::bounded ，它只能缓存一条消息。当缓存满后，发送者继续调用 [crossbeam_channel::Sender::send] 发送消息时会阻塞，直到一个工作线程( 消费者 ) 拿走这条消息 消费者获取消息时先到先得的策略，因此两个工作线程只有一个能取到消息，保证消息不会被重复消费、处理 通过迭代器 crossbeam_channel::Receiver::iter 读取消息会阻塞当前线程，直到新消息的到来或 channel 关闭 channel 只有在所有的发送者或消费者关闭后，才能被关闭。而其中一个消费者 rcv2 处于阻塞读取状态，无比被关闭，因此我们必须要关闭所有发送者: drop(snd1); drop(snd2) ，这样 channel 关闭后，主线程的 rcv2 才能从阻塞状态退出，最后整个程序结束。大家还是迷惑的话，可以看看这篇 文章 。 extern crate crossbeam;
extern crate crossbeam_channel; use std::thread;
use std::time::Duration;
use crossbeam_channel::bounded; fn main() { let (snd1, rcv1) = bounded(1); let (snd2, rcv2) = bounded(1); let n_msgs = 4; let n_workers = 2; crossbeam::scope(|s| { // 生产者线程 s.spawn(|_| { for i in 0..n_msgs { snd1.send(i).unwrap(); println!("Source sent {}", i); } // 关闭其中一个发送者 snd1 // 该关闭操作对于结束最后的循环是必须的 drop(snd1); }); // 通过两个线程并行处理 for _ in 0..n_workers { // 从数据源接收数据，然后发送到下沉端 let (sendr, recvr) = (snd2.clone(), rcv1.clone()); // 生成单独的工作线程 s.spawn(move |_| { thread::sleep(Duration::from_millis(500)); // 等待通道的关闭 for msg in recvr.iter() { println!("Worker {:?} received {}.", thread::current().id(), msg); sendr.send(msg * 2).unwrap(); } }); } // 关闭通道，如果不关闭，下沉端将永远无法结束循环 drop(snd2); // 下沉端 for msg in rcv2.iter() { println!("Sink received {}", msg); } }).unwrap();
}

