} 还可以使用 serde 将数据反序列化成一个强类型的结构体。 use serde::Deserialize;
#[derive(Deserialize)]
struct Record { year: u16, make: String, model: String, description: String,
} fn main() -> Result<(), csv::Error> { let csv = "year,make,model,description
1948,Porsche,356,Luxury sports car
1967,Ford,Mustang fastback 1967,American car"; let mut reader = csv::Reader::from_reader(csv.as_bytes()); for record in reader.deserialize() { let record: Record = record?; println!( "In {}, {} built the {} model. It is a {}.", record.year, record.make, record.model, record.description ); } Ok(())
}

